import {
  Constants,
  inputDataDelivery,
  inputDataSpecial,
} from "../styles/Constants";
import { SerifTextS, SerifTextSS } from "../styles/TextStyles";

export const HistoryFormData = (data: any) => {
  return (
    <div
      style={{
        display: "grid",
        gridTemplateColumns: "repeat( auto-fit, minmax(690px, 1fr) )",
        backgroundColor: "red",
        width: "100%",
      }}
    >
      {inputDataDelivery.data.map((item) => (
        <div
          style={{
            display: "flex",
            flexDirection: "column",
          }}
        >
          <SerifTextSS style={{ textAlign: "left", fontWeight: "300px" }}>
            {Constants.forms[item.value as keyof {}]}:
          </SerifTextSS>
          <SerifTextSS style={{ textAlign: "left" }}>
            {data[item.value as keyof any]}
          </SerifTextSS>
        </div>
      ))}
      {inputDataSpecial.data.map((item) => (
        <div
          style={{
            display: "flex",
            flexDirection: "column",
          }}
        >
          <SerifTextSS style={{ textAlign: "left" }}>
            {Constants.forms[item.value as keyof {}]}:
          </SerifTextSS>
          <SerifTextSS style={{ textAlign: "left" }}>
            {data[item.value as keyof any]}
          </SerifTextSS>
        </div>
      ))}
    </div>
  );
};
